import React from 'react'
import { Box, AppBar, Toolbar, Avatar, Typography, List, ListItem, ListItemButton, ListItemText, Drawer, useTheme } from "@mui/material"

const navItems = ['About', 'Work Experience', 'Projects', 'Contact']

export const NavBar = () => {
    const theme = useTheme()

    return (
        <Box
        sx={{
            backgroundColor: theme.palette.background.default,
        }}
        >
            <AppBar position="static">
                <Toolbar
                sx={{ justifyContent: 'space-between' }}
                >
                    <Box
                        display={'flex'}
                        sx={{
                            alignItems: 'center'
                        }}
                        gap={1}
                    >
                        <Avatar alt="William Ho" src={`${process.env.PUBLIC_URL}/selfimage.jpg`} />
                        <Typography>WILLIAM HO</Typography>
                    </Box>
                    <Box
                    display={'flex'}
                    gap={3}
                    >
                        <Typography>About</Typography>
                        <Typography>Work experience</Typography>
                        <Typography>Projects</Typography>
                        <Typography>Contact</Typography>
                    </Box>



                </Toolbar>
            </AppBar>
        </Box>
    )
}
